import React, { useState } from "react";

export const Detail_Image_Section = (props) => {

    const [Mover, updateLocate] = useState(0)

    

    const photo_dispenser = (input) => {

        switch(typeof input){
            case('object'):
            // console.log(input[0].getUrl())
            return <div
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent:'start',
                        width:'55vw',
                        overflow: 'scroll',
                        aspectRatio: '1'
                    }}
                    
                    onTouchEnd={(e)=>{
                        // const touches = e.changedTouches;
                        // console.log(touches)

                        e.target.scrollBy({
                            top:0,
                            left:e.target.offsetWidth,
                            behavior:'smooth'
                        })
                        
                    }}

                    >

                        {input.map((element)=>{
                        return <img
                        style={{
                            width:'55vw',
                            objectFit: 'cover'
                        }}
                        src={element.getUrl()}
                        >
                        </img>
                        })}

                </div>

            case('undefined'):
            return;
        }

    }

    return <React.Fragment>

    {photo_dispenser(props.photos)}

    </React.Fragment>

}

export default Detail_Image_Section
